import React, { Component } from 'react';
import Nav_character from './nav/nav_character.jsx';
import Nav_introduction from './nav/nav_introduction.jsx';
import Nav_material from './nav/nav_material.jsx';
class Nav extends Component {
    render() {
        return (
            <div className="btn-nav">
                <Nav_character/>
                <Nav_introduction/>
                <Nav_material/>
            </div>
        );
    }
}

export default Nav;
